				self.logo.y = -100;
				moveImageIn(self.logo, {y: 110}, 500, createjs.Ease.sineIn, 1250).to({y: logEndY}, 1000, createjs.Ease.elasticOut);
		
				var buttonEndY = self.button.y;
				self.button.alpha = 1;
				self.button.y = 350;
				moveImageIn(self.button, {y: 135}, 500, createjs.Ease.sineIn, 1250).to({y: buttonEndY}, 1000, createjs.Ease.elasticOut);
		
